//     if (product)
//         res.send(product);
//     else 
//         res.status(404).send ({msg: "Not Found."})  
// }); 

// app.get("/api/products", (req, res) => {
//     res.send(data.products);
// }); 

app.listen(5000, () => {console.log("Server running on http://localhost:5000")})

