            _id: loginUser.id,
            name: loginUser.name,
            email: loginUser.email, 
            isAdmin: loginUser.isAdmin,
            token: getToken(loginUser)
        })
    } else {
        res.status(401).send({msg: 'Password/Email invalid.'});
